import React from "react";
import { Link } from "react-router-dom";
import "./HomePage.css";
import bannerImage from "../banner.jpg"; // Assurez-vous que le chemin de l'image est correct

const HomePage = () => {
  return (
    <div className="home-container" style={{ backgroundImage: `url(${bannerImage})` }}>
      <header className="home-header">
        <h1>Analyse des Logs d'un Data Center Hadoop</h1>
        <p>
          Ce projet a pour objectif de visualiser les tableaux de bord des données d’un data center
          Hadoop en temps réel grâce à Kibana.
        </p>
      </header>

      <div className="button-container">
        <Link to="/kibana/datacenter1">
          <button className="dashboard-button">Voir Dashboard Datacenter 1</button>
        </Link>
        <Link to="/kibana/datacenter2">
          <button className="dashboard-button">Voir Dashboard Datacenter 2</button>
        </Link>
      </div>
    </div>
  );
};

export default HomePage;
